var prevScrollpos = window.pageYOffset;
window.onscroll = function () {
  var currentScrollPos = window.pageYOffset;
  const elem = document.getElementById("m-support");
  const elem50 = document.getElementById("m-support-scroll-50");
  const elemTop0 = document.getElementById("m-support-scroll-0");
  if (elem) {
    if (prevScrollpos > currentScrollPos || currentScrollPos == 0) {
      elem.style.marginTop = "0";
      elem.style.borderTop = "1";
      elem.style.zIndex = "1";
    } else {
      elem.style.marginTop = "-52px";
      elem.style.borderTop = "0";
      elem.style.zIndex = "-1";
    }
  }
  if (elem50) {
    elem50.style.transition = "all 0.2s ease-in-out";
    if (prevScrollpos > currentScrollPos || currentScrollPos == 0) {
      elem50.style.marginTop = "0";
      elem50.style.borderTop = "1";
      elem50.style.zIndex = "1";
    } else if (currentScrollPos > 200) {
      elem50.style.marginTop = "-52px";
      elem50.style.borderTop = "0";
      elem50.style.zIndex = "-1";
    }
  }
  if (elemTop0) {
    elemTop0.style.transition = "all 0.2s ease-in-out";
    if (currentScrollPos == 0) {
      elemTop0.style.marginTop = "0";
      elemTop0.style.borderTop = "1";
      elemTop0.style.zIndex = "1";
    } else if (currentScrollPos > 140) {
      elemTop0.style.marginTop = "-52px";
      elemTop0.style.borderTop = "0";
      elemTop0.style.zIndex = "-1";
    }
  }
  prevScrollpos = currentScrollPos;
};


