function sanitize1(string) {
  if (typeof (string) == "string") {
    const map = {
      '<': '&lt;',
      '>': '&gt;',
      '"': '&quot;',
      "'": '&#x27;',
      //   "/": '&#x2F;',
    };
    const reg = /[<>"']/ig;
    return string.replace(reg, (match) => (map[match]));
  } else {
    return string;
  }
}

