document.addEventListener("DOMContentLoaded", () => {
  const elements = document.querySelectorAll(".fade-in-up-on-scroll");

  const observer = new IntersectionObserver(
    (entries) => {
      entries.forEach((entry) => {
        if (entry.isIntersecting) {
          entry.target.classList.add("in-view");
        }
      });
    },
    {
      threshold: 0.1, // Trigger when 10% of the element is in the viewport
    }
  );

  elements.forEach((element) => {
    observer.observe(element);
  });
});

var heritageBanner = document.getElementById("heritage-banner");

$(document).ready(function () {
  if (heritageBanner) {
    if ($("#heritage-banner").hasClass("mayura-intro-section")) {
    } else {
      $("body").addClass("bg-ashva");
    }
  }
  var pageName;
  if ($(".mayura-intro-section").length > 0){
    pageName = "mayura"
  }else{
    pageName = "ashva"
  }



$(".redirect").on("click",function(event){
  event.preventDefault();

  var anchorName = $(this).data("anchor-name");
  var urlRedirection = $(this).data("url-redirection");
  var linkPageName;
  if ($(".mayura-intro-section").length > 0){
    linkPageName = "cc:mayura:landing page"
  }else{
    linkPageName = "cc:ashva:landing page"
  }

  location.href = urlRedirection;
})

});

const section = document.querySelector(".section-ashv-intro");
// Detect user-initiated scroll and manage animation
const handleScrollOrTouch = (event) => {
  if (section && (!scrollBlocked && !section.classList.contains("animate"))) {
    section.classList.add("animate");
    scrollBlocked = true;
    event.preventDefault();
    window.scrollTo(0, window.scrollY); // Prevent scrolling by resetting scroll position
    setTimeout(() => {
      scrollBlocked = false; // Allow scrolling after 1 second
    }, 1000); // Assuming animation duration is 1 second
  } else if (scrollBlocked) {
    event.preventDefault(); // Prevent scrolling if scrollBlocked is true
  }
};

