// Handle click events on the go-back-link
$(".ashv-new-container #experience-it").on("click", function (event) {
  $(".ashv-new-container #step2").slideDown().fadeIn();
  $(".ashv-new-container #step1").slideUp();
});

$(".ashv-new-container .go-back-link").on("click", function (event) {
  event.preventDefault(); // Prevent default action
  var parentDiv = $(this).closest("div"); // Get the parent div element
  var parentId = parentDiv.attr("id"); // Get the ID of the parent div
  if (parentId === "text-1") {
    $(".ashv-new-container #step2").slideUp();
    $(".ashv-new-container #step1").slideDown();
  } else {
    var number = parentId.split("-")[1]; // Get the number part of the ID

    // Form the ID for the corresponding plus link
    var plusId = `#plus-${parseInt(number) - 1}`;

    // Trigger the click event on the corresponding plus link
    $(`.ashv-new-container .figure a${plusId}`).trigger("click");
  }
});

