var animatedPopUp = document.getElementById("applyNowPopuP")

if ($(".ashv-new-container").is(":visible")) {
  // $("body").css("overflow", "hidden");

  setTimeout(function () {
    $(".ashv-intro-container").fadeToggle();
    $("body").css("overflow", "");
    clearInterval(scrollInterval);
    if (animatedPopUp) {
      setTimeout(function () {
        $('#applyNowPopuP').modal('show');
        $("body").addClass("modal-popup");
        $("body").removeClass("modal-open");
      }, 1000);
    }
  }, 4000);
  // Remove "modal-open" class from body when the modal is closed
  if (animatedPopUp) {
    console.log("found")

    $("body").click(() => {

      if ($(animatedPopUp).hasClass("show")) {
        setTimeout(function () {
          $("body")
            .append('<div class="modal-backdrop fade show"></div>');
        }, 500)
      }
    })

    $('#applyNowPopuP').on('hidden.bs.modal', function () {
      $("body").removeClass("modal-popup");
      $(".modal-backdrop").remove();
    });
  } else {
    console.log("notFound")
  }
}

