// Initialize the Story Swiper
var storySlider = new Swiper(".story__slider", {
  speed: 1,
  watchSlidesProgress: true,
  loop: true,
  autoplay: {
    delay: 5000,
    disableOnInteraction: false,
  },
  slidesPerView: 1,
  navigation: {
    nextEl: ".story__next",
    prevEl: ".story__prev",
  },
  pagination: {
    el: ".story__pagination",
    renderBullet: function (index, className) {
      return (
        '<div class="' +
        className +
        '"> <div class="swiper-pagination-progress"></div> </div>'
      );
    },
  },
  on: {
    autoplayTimeLeft(swiper, time, progress) {
      let currentSlide = document.querySelector(
        ".swiper-slide-active .story__slider .swiper-slide-active"
      );
      let currentBullet = document.querySelectorAll(
        ".swiper-slide-active  .story__slider .swiper-pagination-progress"
      )[swiper.realIndex];
      let fullTime = currentSlide?.dataset.swiperAutoplay
        ? parseInt(currentSlide?.dataset.swiperAutoplay)
        : swiper.params.autoplay.delay;

      let percentage =
        Math.min(
          Math.max(
            parseFloat((((fullTime - time) * 100) / fullTime).toFixed(1)),
            0
          ),
          100
        ) + "%";
      gsap.set(currentBullet, { width: percentage });
    },
    transitionEnd(swiper) {
      resetSlideProgress(swiper);
    },
  },
});

function checkAndPauseSwiper() {
  const activeSlideIndex = allThingMoneySwiper?.activeIndex;
  let storySliderelement = document.querySelector(".story__slider")
  if (storySliderelement && storySlider) {
    console.log(storySlider);
    storySlider.forEach((swiper, index) => {
      // Get the parent element of the swiper
      const parentElement = $(swiper.el).parents(".swiper-item");
      // Check if the parent element has the class "active"
      const isActive = parentElement.hasClass("swiper-slide-active");
      if (index === activeSlideIndex && isActive) {
        resetSlideProgress(swiper).then(() => {
          setTimeout(() => {
            swiper.autoplay.start();
          }, 200);
        });
      } else {
        swiper.autoplay.stop();
      }
    });
  }
}

// Initial check
checkAndPauseSwiper();

async function resetSlideProgress(swiper) {
  let allBullets = $(
    ".swiper-slide-active .story__slider .swiper-pagination-progress"
  );
  let bulletsBefore = allBullets.slice(0, swiper.realIndex);
  let bulletsAfter = allBullets.slice(swiper.realIndex, allBullets.length);

  if (bulletsBefore.length) {
    gsap.set(bulletsBefore, { width: "100%" });
  }
  if (bulletsAfter.length) {
    gsap.set(bulletsAfter, { width: "0%" });
  }

  let activeSlide = document.querySelectorAll(
    ".swiper-slide-active .story__slider .swiper-slide"
  )[swiper.realIndex];
  if (activeSlide.querySelector("video")) {
    activeSlide.querySelector("video").currentTime = 0;
  }

  // Return a resolved promise to ensure asynchronous behavior
  return Promise.resolve();
}
