//#feature .card Animation
const cards = document.querySelectorAll(".desktop .card");
const cardsMobile = document.querySelectorAll(".mobile .card");

if (cards || cardsMobile) {
  gsap.registerPlugin(ScrollTrigger);

  cards.forEach((card) => {
    gsap.to(card, {
      scrollTrigger: {
        trigger: card,
        start: "top bottom",
        end: "center center",
        scrub: 0.5, // smooth scrubbing, takes 1 second to "catch up" to the scrollbar
        //markers: true, // for debugging, remove in production
      },
      x: "-0.5vw",
      y: "0vh",
      top: "0",
      rotationZ: 0,
      ease: "power4.out",
    });
  });

  cardsMobile.forEach((card) => {
    gsap.to(card, {
      scrollTrigger: {
        trigger: card,
        start: "top bottom",
        end: "center center",
        scrub: 0.5, // smooth scrubbing, takes 1 second to "catch up" to the scrollbar
        //markers: true, // for debugging, remove in production
      },
      x: "-0.5vw",
      y: "0vh",
      top: "0",
      rotationZ: 0,
      ease: "power4.out",
    });
  });
}
document.querySelectorAll(".ashv-navigation a").forEach((anchor) => {
  anchor.addEventListener("click", function (e) {


    if (this.getAttribute("href").startsWith("#")) {
      e.preventDefault();
      document
        .querySelectorAll(".ashv-navigation a")
        .forEach((el) => el.classList.remove("active"));

      this.classList.add("active");
      const targetId = this.getAttribute("href").substring(1);
      const targetElement = document.getElementById(targetId);

      if (targetElement) {
        targetElement.scrollIntoView({ behavior: "smooth" });
      }
    }

  });
});

window.addEventListener("scroll", function () {
  const navigation = document.getElementById("ashv-navigation");
  var benifitSwiper = document.querySelector(".benifit-swiper");
  // Get the position of the #benifit-swiper relative to the top of the viewport
  var benifitSwiperTop = benifitSwiper?.getBoundingClientRect().top;
  // Set your offset value here
  var offset = 0; // You can change this value to the desired offset

  // Check if the #benifit-swiper is at the top or within the offset range
  if (benifitSwiperTop <= offset) {
    navigation?.classList.add("sticky");
  } else {
    navigation?.classList.remove("sticky");
  }
});
