//GSAP ANIMATION Common Ladng Page
gsap.registerPlugin(ScrollTrigger);

ScrollTrigger.defaults({
  scroller: document.documentElement
});

ScrollTrigger.config({
  limitCallbacks: true,
  ignoreMobileResize: true
});

let sections = Array.from(document.querySelectorAll(".common-lp-slider"));
let container = document.querySelector(".horizontal-scroll-section");

if (container) {
  gsap.to(container, {
    ease: "none",
    scrollTrigger: {
      trigger: container,
      pin: true,
      scrub: 1,
      xPercent: -200, // Moves the entire section to the left by 200% (since you have 3 slides)
      snap: {
        snapTo: 1 / (sections.length - 1), // Snap to each slide
        duration: { min: 0.2, max: 0.5 }, // Snap duration
        delay: 0.1 // Delay for snapping
      },
      invalidateOnRefresh: true,
      onUpdate: self => {
        let progress = self.progress.toFixed(5);
        container.scrollTo((container.scrollWidth - window.innerWidth) * progress, 0);

        // Determine which slide is in view
        let currentSlideIndex = Math.round(progress * (sections.length - 1));
        sections.forEach((section, index) => {
          if (index === currentSlideIndex) {
            section.querySelectorAll('.os-animation').forEach(el => {
              el.classList.add('active');
            });
          } else {
            section.querySelectorAll('.os-animation').forEach(el => {
              el.classList.remove('active');
            });
          }
        });
      },
      onScrubComplete: ({ progress, direction, isActive }) => console.log(progress.toFixed(3), direction, isActive),
      end: () => "+=" + (container.scrollWidth - window.innerWidth)
    }
  });
}

"use strict";
// Ensure jQuery is loaded
if (typeof jQuery === "undefined") {
  throw new Error("jQuery is not loaded");
}
if ($("#grexitintentPopup").length) {
  let ShowPopup = true;
  let touchStartY = 0;
  let touchStartTime = 0;
  // Remove modal-open class from body when the popup is closed
  $("#grexitintentPopup").on("hidden.bs.modal", function () {
    $("body").removeClass("modal-open");
  });

  // function showExitIntentPopup() {
  //   if (!ShowPopup) return;
  //   if ($("#grexitintentPopup").length && !$("#grexitintentPopup").hasClass("show")) {
  //     $("#grexitintentPopup").modal("show");
  //     $("body").addClass("modal-open");
  //     setTimeout(function () {
  //       $(".modal-backdrop").addClass("grexit-int");
  //     }, 10);
  //     ShowPopup = false;
  //   }
  // }

  function showExitIntentPopup() {
    if (!ShowPopup) return;
    if ($("#grexitintentPopup").length && !$("#grexitintentPopup").hasClass("show")) {
      // $("#grexitintentPopup").modal("show");
      $("#grexitintentPopup").addClass("show").show();
      $("body")
        .addClass("modal-open")
        .append('<div class="modal-backdrop fade show"></div>');
      setTimeout(function () {
        $(".modal-backdrop").addClass("grexit-int");
      }, 10);
      ShowPopup = false;
    }
  }

  $(".popup-close.op1, .modalClose").on("click", function () {
    //console.log(popup_url);
    $("#grexitintentPopup")
      .removeClass("show")
      .fadeOut(function () {
        $(".modal-backdrop").remove();
        $("body").removeClass("modal-open");
      });
    return false;
  });

  // Desktop detection
  $(document).on("mouseleave", function (e) {
    if (e.clientY < 10) {
      showExitIntentPopup();
    }
  });

  // Detect back button (simulated exit intent)
  window.addEventListener("popstate", function () {
    showExitIntentPopup();
  });

  // Detect alt + back arrow (simulated exit intent)
  window.addEventListener("keydown", function (e) {
    if (e.altKey && e.key === "ArrowLeft") {
      showExitIntentPopup();
      history.pushState(null, null, location.href);
    }
  });

  // Detect backspace key
  window.addEventListener("keydown", function (e) {
    if (e.key === "Backspace" && !e.target.matches("input, textarea")) {
      e.preventDefault(); // Prevent default back navigation
      showExitIntentPopup();
    }
  });

  // **Mobile Exit Intent**
  let lastScrollY = window.scrollY;
  // Detect fast upward scroll (suggests user might be leaving)
  window.addEventListener("scroll", function () {
    let scrollDiff = lastScrollY - window.scrollY;
    if (scrollDiff > 100) { // Adjust threshold as needed
      showExitIntentPopup();
    }
    lastScrollY = window.scrollY;
  });

  $(document).ready(function () {
    let idleTimeout = setTimeout(function () {
      showExitIntentPopup();
    }, 10000);

    let idleTime = parseInt(sanitize($("#grexitintentPopup").data("idleTime"))) || 5000;
    window.addEventListener("scroll", function () {
      clearTimeout(idleTimeout);
      idleTimeout = setTimeout(function () {
        showExitIntentPopup();
      }, idleTime); // 10 seconds idle time for mobile
    });
  });

  window.addEventListener("popstate", function () {
    showExitIntentPopup();
  });
  document.addEventListener("visibilitychange", function () {
    if (document.hidden) return;
    showExitIntentPopup();
  });
}
