$(document).ready(function () {
  var length = $("#gcoverview").data("words") || 150;
  cHtml = $("#gcoverview").html();
  cText = $("#gcoverview").text().substr(0, length).trim();
  $("#gcoverview")
    .addClass("compressed")
    .html(cText + "... <a href='#' class='exp'>Read More</a>");
  window.handler = function () {
    $(".exp").click(function () {
      if ($("#gcoverview").hasClass("compressed")) {
        $("#gcoverview").html(
          cHtml + "<a href='#' class='exp'>Read Less</a>"
        );
        $("#gcoverview").removeClass("compressed");
        handler();
        return false;
      } else {
        $("#gcoverview").html(
          cText + "... <a href='#' class='exp'>Read More</a>"
        );
        $("#gcoverview").addClass("compressed");
        handler();
        return false;
      }
    });
  };
  handler();
});

document.addEventListener("DOMContentLoaded", () => {
  const elements = document.querySelectorAll(".fade-in-up-on-scroll");

  const observer = new IntersectionObserver(
    (entries) => {
      entries.forEach((entry) => {
        if (entry.isIntersecting) {
          entry.target.classList.add("in-view");
        }
      });
    },
    {
      threshold: 0.1, // Trigger when 10% of the element is in the viewport
    }
  );

  elements.forEach((element) => {
    observer.observe(element);
  });
});


